import React from "react";
import "./Upgrade.css";
import Header from "../Workplace/Header";

import { Link, useHistory } from "react-router-dom";

import {
    Pane,
    DragHandleVerticalIcon,
    Popover,
    Menu,
    TextInputField,
    TextInput,
    Dialog,
    SelectMenu,
    Avatar,
    MoreIcon,
    Position,
} from "evergreen-ui";

function Upgrad() {
    let history = useHistory();
    const [isShown, setIsShown] = React.useState(false);

    return (
        <div>
            <Header />
            <div>
                <div className="pricing">
                    <h1 className="developer">Developer</h1>
                    <h1 className="preview">Preview</h1>
                </div>
                <div className="pricing_version">
                    <h1 className="version">Version</h1>
                </div>
            </div>

            <Pane
                className="space"
                onClick={() => {
                    history.push("/dashboard");
                }}
                onMouseOver={() => setIsShown(true)}
            ></Pane>
            {isShown && (
                <Popover
                    minWidth={50}
                    content={
                        <Menu>
                            <Menu.Group>
                                <Menu.Item>
                                    <p className="menucontent">Rename space</p>
                                </Menu.Item>
                                <Menu.Item>
                                    <p className="menucontent">Share</p>
                                </Menu.Item>
                                <Menu.Item>
                                    <p className="menucontent">Move space</p>
                                </Menu.Item>
                                <Menu.Item>
                                    <p className="menucontent">Duplicate</p>
                                </Menu.Item>
                                <Menu.Item intent="danger">
                                    <p className="menucontentred">Delete</p>
                                </Menu.Item>
                            </Menu.Group>
                        </Menu>
                    }
                >
                    <MoreIcon className="a" />
                </Popover>
            )}
        </div>
    );
}

export default Upgrad;
